 updates and features to help secure and optimize your store','Magento Open Source 2.4.2, along with security-only patches 2.3.6-p1 and 2.4.1-p1, is now generally available. The latest release of Magento Open Source includes important security enhancements along with new functionality and platform quality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. Learn how this release can help you save time and maximize resources at Magento.com/blog. ','https://devdocs.magento.com/guides/v2.4/release-notes/bk-release-notes.html',0,0),('63',4,'2021-02-10 15:08:37','Register now for Summit 2021 and stay ahead of commerce trends ','Learn best practices from digital commerce experts during two days of live keynotes, sessions, and sneak peeks. Understand the latest digital commerce trends, discover industry best practices, and network with peers around the world. Register now!','https://summit.adobe.com/na/?utm_source=m1o&amp;utm_medium=rss&amp;utm_campaign=NA_210427_12576_RSS_EVTR_ACOM_FM_Summit_2021_M1_OS',0,0),('64',4,'2021-02-22 23:52:27','Quarterly Business Planning - reach out to us today to get your free site assessment.','Would you like a free site assessment? Our best-in-breed commerce solution gives your business unmatched agility and scalability. It&#039;s time to experience limitless eCommerce with no comprises. Learn more: https://bit.ly/3lcgILt','https://bit.ly/3lcgILt',0,0),('65',1,'2021-02-26 04:47:41','Attention! Your Blog extension version is extremely outdated. It is strongly recommended to update it to the latest version 2.9.8',' \n                                    https://magefan.com/magento2-blog-extension?ancient=2.9.1                                 ','https://magefan.com/magento2-blog-extension?ancient=2.9.1',0,0),('66',4,'2021-02-26 04:47:41','NEW Magento 2 Zero Downtime Deployment Extension.',' Do you hate to see when your store is broken while running Magento 2 deployment commands? Install New Zero Downtime Deployment extension and forget about it. Deploy new features and bug fixes without interrupting your customers.','https://magefan.com/magento-2-zero-downtime-deployment?from=ntf-new',0,0),('67',4,'2021-03-23 00:33:54','You&#039;re invited to our webinar this week: How digital commerce can scale B2B selling','Digital commerce is fast becoming the default way to buy—even for B2B customers. In just 8 weeks, Byrne Electrical, the leading manufacturer of power and data solutions for numerous industries, launched an eCommerce portal for more than 1,100 of their customers. To learn how they did it, join George Fabis, Director of IT for Byrne, and Slava Kravchuk, CEO &amp; Founder of Atwix, a Magento Commerce solutions partner, for a live discussion on Thursday, March 25. Register Now: https://bit.ly/3r1MCvG','https://bit.ly/3r1MCvG',0,0),('68',4,'2021-05-11 20:44:41','Magento Open Source 2.4.2-p1 &amp; 2.3.7 deliver important security updates','The latest releases of Magento Open Source – 2.3.7 and 2.4.2-p1 – are now generally available. The latest release of Magento Open Source includes important security updates. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the updates. Learn how this release can help you save time and maximize resources at Magento.com/blog.','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html ',0,0),('69',4,'2021-08-10 17:53:11','Magento Open Source 2.4.3 available today!','Magento Open Source 2.4.3, along with security-only patches 2.4.2-p1 and 2.3.7-p2, is now generally available. Magento Open Source 2.4.3 includes 33 security and 370+ quality improvements, along with performance and scale enhancements.  With these important updates, we strongly recommend that you upgrade to maintain the highest level of security for your sites. Learn how this release can help you save time and maximize resources in our release blog. ','http://magento.com/blog/magento-news/get-ready-your-peak-season-adobe-commerce-243',0,0),('70',4,'2021-10-01 14:44:47','New, Simplified Upgrade Process and Lifecycle Policy Helps Reduce Your TCO ','Adobe Commerce developed a new release strategy and updated its lifecycle policy in effort to help Merchants lower their total cost of ownership and accelerate their time to innovation. Learn more about how upgrades are now more predictable and easier to implement in our blog.','https://magento.com/blog/accelerating-innovation-through-simplified-release-strategy',0,0),('71',4,'2021-10-22 19:06:48','Magento Technology Stack Evaluation Survey','Please take a few minutes to fill out this survey https://forms.office.com/r/DLN8K3h2h0. We appreciate your effort to support the future of Adobe Commerce!','https://forms.office.com/r/DLN8K3h2h0',0,0),('72',2,'2022-02-17 16:49:28','Security update available for Adobe Commerce | APSB22-12','Adobe has released security updates for Adobe Commerce and Magento Open Source. These updates resolve vulnerabilities rated critical. Full details included in security bulletin.','https://helpx.adobe.com/security/products/magento/apsb22-12.html',0,0),('73',2,'2022-03-01 23:33:53','Magento Open Source 2.4.4 Coming April 12','To help ensure this release delivers the highest standards of security and quality, general availability of Magento Open Source is now planned for April 12. For more information, visit our DevBlog. ','https://community.magento.com/t5/Magento-DevBlog/Adobe-Commerce-2-4-4-Now-Coming-April-12/ba-p/492935',0,0),('74',2,'2022-04-12 16:52:58','Magento Open Source 2.4.4 Available Now!','Magento Open Source 2.4.4 enables customers to future-proof and accelerate the growth of their digital commerce businesses. This release is our fastest and most scalable version ever, with increased GraphQL API coverage for several Admin features, as well as new capabilities to PWA Studio 12.3.  Learn how this release can help you save time and maximize resources in our release blog. ','https://business.adobe.com/blog/perspectives/future-proof-your-business-with-adobe-commerce-2-4-4',0,0),('75',4,'2022-05-24 15:06:25','Prepared to upgrade to Magento Open Source 2.4.4?','With 2.3 end of support (EOS) in September and 2.4.0-2.4.3 EOS in November, it is critical to have an upgrade plan in place to make sure your site stays secure, performant and PCI-Compliant. Learn more about how Magento Open Source 2.4.4 will future-proof your business.','https://business.adobe.com/blog/perspectives/future-proof-your-business-with-adobe-commerce-2-4-4',0,0),('76',4,'2022-07-26 16:18:18','Expanded video library on the Adobe Commerce Experience League','Check out our expanded video library on the Adobe Commerce Experience League that now has a set of 35 short demo videos of our core Adobe Commerce capabilities and support tools.','https://experienceleague.adobe.com/docs/commerce-learn/tutorials/overview.html?lang=en',0,0),('77',1,'2022-10-11 16:58:58','Magento Open Source Security Patches Now Available','Adobe is excited to announce that Magento Open Source security-only patches 2.4.5-p1 and 2.4.4-p2 are now available to our entire Commerce Community. In this release, you will find several security enhancements. Refer to the Readying your business for peak season shopping blog for more information and other exciting upgrades. ','https://business.adobe.com/blog/the-latest/readying-your-business-for-peak-season-shopping',0,0),('78',3,'2022-12-21 13:59:50','New version 2.10.11 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                    https://magefan.com/magento2-blog-extension?version=2.10.11\n                                 ','https://magefan.com/magento2-blog-extension?version=2.10.11',0,0),('79',4,'2022-12-14 00:00:00','Christmas Sale - get $30 OFF! ','Have a wonderful Christmas Season! Grab your discount now: https://magefan.com/magento-2-extensions','https://magefan.com/magento-2-extensions?utm_source=website&amp;utm_medium=admin-ntf&amp;utm_campaign=christmas-22',0,0);
