INSERT INTO `cms_page` VALUES (1,'404 Not Found','1column','Page keywords','Page description','no-route','Whoops, our bad...','<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li></ul></dd></dl>\r\n','2016-08-04 16:00:20','2016-08-09 16:01:32',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,'Home page','1column',NULL,NULL,'home',NULL,'<div class=\"content-banner clearfix\">\r\n	   <div class=\"row\">\r\n			<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-12 column-left\">\r\n				<div class=\"banner-inner\">\r\n					<a href=\"#\"><img src=\"{{media url=\"wysiwyg/alothemes/static/demo1/banner1.jpg\"}}\" alt=\"banner\" class=\"u-photo img-responsive\"></a>\r\n					<div class=\"text-content\">						\r\n						<h3 class=\"p-name\">WOMEN & <br/>DRESSESS</h3>			\r\n					</div>\r\n				</div>\r\n			</div>\r\n			<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-12 column-center\">\r\n				<div class=\"banner-inner\">\r\n					<a href=\"#\"><img src=\"{{media url=\"wysiwyg/alothemes/static/demo1/banner2.jpg\"}}\" alt=\"banner\" class=\"u-photo img-responsive\"></a>\r\n					<div class=\"text-content\">							\r\n						<h3 class=\"p-name\">ACCESSORIES<br/> COLLECTION</h3>			\r\n					</div>\r\n				</div>\r\n			</div>\r\n			<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-12 column-right\">\r\n				<div class=\"banner-inner\">\r\n					<a href=\"#\"><img src=\"{{media url=\"wysiwyg/alothemes/static/demo1/banner3.jpg\"}}\" alt=\"banner\" class=\"u-photo img-responsive\"></a>\r\n					<div class=\"text-content\">						\r\n						<h3 class=\"p-name\">MEN & <br/>CLOTHING</h3>			\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n</div>\r\n<!-- Home product-->\r\n<div class=\"content-1-trendy-product\">\r\n    <div class=\"main-content\">\r\n         {{widget type=\"Magiccart\\Magicproduct\\Block\\Widget\\Product\" identifier=\"main-product-01\" template=\"product.phtml\"}}\r\n    </div>\r\n</div>','2016-08-04 16:00:21','2016-08-06 03:19:54',1,0,'<!-- Slide showcase-->\r\n<referenceContainer name=\"slide.showcase\">\r\n			<block class=\"Magento\\Cms\\Block\\Block\" name=\"slide\">\r\n				<arguments>\r\n					<argument name=\"block_id\" xsi:type=\"string\">home-slide1</argument>\r\n				</arguments>\r\n			</block>\r\n</referenceContainer>\r\n<!-- alo.sectionsbottom -->\r\n<referenceContainer name=\"alo.sectionsbottom\">\r\n        	<block class=\"Magento\\Cms\\Block\\Block\" name=\"cms-static-policy\">\r\n		<arguments>\r\n			<argument name=\"block_id\" xsi:type=\"string\">cms-static-policy</argument>\r\n		</arguments>\r\n	</block>\r\n	<block class=\"Magento\\Cms\\Block\\Block\" name=\"cms-static-blog\">\r\n		<arguments>\r\n			<argument name=\"block_id\" xsi:type=\"string\">cms-static-blog</argument>\r\n		</arguments>\r\n	</block>\r\n</referenceContainer>\r\n<!--\r\n    <referenceContainer name=\"right\">\r\n        <action method=\"unsetChild\"><argument name=\"alias\" xsi:type=\"string\">right.reports.product.viewed</argument></action>\r\n        <action method=\"unsetChild\"><argument name=\"alias\" xsi:type=\"string\">right.reports.product.compared</argument></action>\r\n    </referenceContainer>-->',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,'Enable Cookies','1column',NULL,NULL,'enable-cookies','What are Cookies?','<div class=\"enable-cookies cms-content\">\r\n<p>\"Cookies\" are little pieces of data we send when you visit our store. Cookies help us get to know you better and personalize your experience. Plus they help protect you and other shoppers from fraud.</p>\r\n<p style=\"margin-bottom: 20px;\">Set your browser to accept cookies so you can buy items, save items, and receive customized recommendations. Here’s how:</p>\r\n<ul>\r\n<li><a href=\"https://support.google.com/accounts/answer/61416?hl=en\" target=\"_blank\">Google Chrome</a></li>\r\n<li><a href=\"http://windows.microsoft.com/en-us/internet-explorer/delete-manage-cookies\" target=\"_blank\">Internet Explorer</a></li>\r\n<li><a href=\"http://support.apple.com/kb/PH19214\" target=\"_blank\">Safari</a></li>\r\n<li><a href=\"https://support.mozilla.org/en-US/kb/enable-and-disable-cookies-website-preferences\" target=\"_blank\">Mozilla/Firefox</a></li>\r\n</ul>\r\n</div>','2016-08-04 16:00:21','2016-08-04 16:00:21',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,'Privacy and Cookie Policy','1column',NULL,NULL,'privacy-policy-cookie-restriction-mode','Privacy and Cookie Policy','<div class=\"privacy-policy cms-content\">\n    <div class=\"message info\">\n        <span>\n            Please replace this text with you Privacy Policy.\n            Please add any additional cookies your website uses below (e.g. Google Analytics).\n        </span>\n    </div>\n    <p>\n        This privacy policy sets out how this website (hereafter \"the Store\") uses and protects any information that\n        you give the Store while using this website. The Store is committed to ensuring that your privacy is protected.\n        Should we ask you to provide certain information by which you can be identified when using this website, then\n        you can be assured that it will only be used in accordance with this privacy statement. The Store may change\n        this policy from time to time by updating this page. You should check this page from time to time to ensure\n        that you are happy with any changes.\n    </p>\n    <h2>What we collect</h2>\n    <p>We may collect the following information:</p>\n    <ul>\n        <li>name</li>\n        <li>contact information including email address</li>\n        <li>demographic information such as postcode, preferences and interests</li>\n        <li>other information relevant to customer surveys and/or offers</li>\n    </ul>\n    <p>\n        For the exhaustive list of cookies we collect see the <a href=\"#list\">List of cookies we collect</a> section.\n    </p>\n    <h2>What we do with the information we gather</h2>\n    <p>\n        We require this information to understand your needs and provide you with a better service,\n        and in particular for the following reasons:\n    </p>\n    <ul>\n        <li>Internal record keeping.</li>\n        <li>We may use the information to improve our products and services.</li>\n        <li>\n            We may periodically send promotional emails about new products, special offers or other information which we\n            think you may find interesting using the email address which you have provided.\n        </li>\n        <li>\n            From time to time, we may also use your information to contact you for market research purposes.\n            We may contact you by email, phone, fax or mail. We may use the information to customise the website\n            according to your interests.\n        </li>\n    </ul>\n    <h2>Security</h2>\n    <p>\n        We are committed to ensuring that your information is secure. In order to prevent unauthorised access or\n        disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and\n        secure the information we collect online.\n    </p>\n    <h2>How we use cookies</h2>\n    <p>\n        A cookie is a small file which asks permission to be placed on your computer\'s hard drive.\n        Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit\n        a particular site. Cookies allow web applications to respond to you as an individual. The web application\n        can tailor its operations to your needs, likes and dislikes by gathering and remembering information about\n        your preferences.\n    </p>\n    <p>\n        We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page\n        traffic and improve our website in order to tailor it to customer needs. We only use this information for\n        statistical analysis purposes and then the data is removed from the system.\n    </p>\n    <p>\n        Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find\n        useful and which you do not. A cookie in no way gives us access to your computer or any information about you,\n        other than the data you choose to share with us. You can choose to accept or decline cookies.\n        Most web browsers automatically accept cookies, but you can usually modify your browser setting\n        to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\n    </p>\n    <h2>Links to other websites</h2>\n    <p>\n        Our website may contain links to other websites of interest. However, once you have used these links\n        to leave our site, you should note that we do not have any control over that other website.\n        Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst\n        visiting such sites and such sites are not governed by this privacy statement.\n        You should exercise caution and look at the privacy statement applicable to the website in question.\n    </p>\n    <h2>Controlling your personal information</h2>\n    <p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\n    <ul>\n        <li>\n            whenever you are asked to fill in a form on the website, look for the box that you can click to indicate\n            that you do not want the information to be used by anybody for direct marketing purposes\n        </li>\n        <li>\n            if you have previously agreed to us using your personal information for direct marketing purposes,\n            you may change your mind at any time by letting us know using our Contact Us information\n        </li>\n    </ul>\n    <p>\n        We will not sell, distribute or lease your personal information to third parties unless we have your permission\n        or are required by law to do so. We may use your personal information to send you promotional information\n        about third parties which we think you may find interesting if you tell us that you wish this to happen.\n    </p>\n    <p>\n        You may request details of personal information which we hold about you under the Data Protection Act 1998.\n        A small fee will be payable. If you would like a copy of the information held on you please email us this\n        request using our Contact Us information.\n    </p>\n    <p>\n        If you believe that any information we are holding on you is incorrect or incomplete,\n        please write to or email us as soon as possible, at the above address.\n        We will promptly correct any information found to be incorrect.\n    </p>\n    <h2><a name=\"list\"></a>List of cookies we collect</h2>\n    <p>The table below lists the cookies we collect and what information they store.</p>\n    <table class=\"data-table data-table-definition-list\">\n        <thead>\n        <tr>\n            <th>Cookie Name</th>\n            <th>Cookie Description</th>\n        </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <th>FORM_KEY</th>\n                <td>Stores randomly generated key used to prevent forged requests.</td>\n            </tr>\n            <tr>\n                <th>PHPSESSID</th>\n                <td>Your session ID on the server.</td>\n            </tr>\n            <tr>\n                <th>GUEST-VIEW</th>\n                <td>Allows guests to view and edit their orders.</td>\n            </tr>\n            <tr>\n                <th>PERSISTENT_SHOPPING_CART</th>\n                <td>A link to information about your cart and viewing history, if you have asked for this.</td>\n            </tr>\n            <tr>\n                <th>STF</th>\n                <td>Information on products you have emailed to friends.</td>\n            </tr>\n            <tr>\n                <th>STORE</th>\n                <td>The store view or language you have selected.</td>\n            </tr>\n            <tr>\n                <th>USER_ALLOWED_SAVE_COOKIE</th>\n                <td>Indicates whether a customer allowed to use cookies.</td>\n            </tr>\n            <tr>\n                <th>MAGE-CACHE-SESSID</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>MAGE-CACHE-STORAGE</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>MAGE-CACHE-STORAGE-SECTION-INVALIDATION</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>MAGE-CACHE-TIMEOUT</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>SECTION-DATA-IDS</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>PRIVATE_CONTENT_VERSION</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>X-MAGENTO-VARY</th>\n                <td>Facilitates caching of content on the server to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>MAGE-TRANSLATION-FILE-VERSION</th>\n                <td>Facilitates translation of content to other languages.</td>\n            </tr>\n            <tr>\n                <th>MAGE-TRANSLATION-STORAGE</th>\n                <td>Facilitates translation of content to other languages.</td>\n            </tr>\n        </tbody>\n    </table>\n</div>','2016-08-04 16:00:21','2016-09-17 03:35:36',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,'About Us','1column',NULL,NULL,'about-magento-demo-store',NULL,'<div class=\"about-us\">\r\n	<div class=\"col3-set row\">\r\n		<div class=\"col2 col-lg-9 col-md-9 col-sm-12 col-xs-12\">\r\n			<img class=\"img-responsive\" alt=\"banner\" src=\"{{media url=\"wysiwyg/alothemes/static/logo-footer.png\"}}\" />\r\n			<p>Aene ultrice dolor quis varius conquat, enim sem consequa mass tortor, eget massa volutpat pretium. Sed suscipit velit ligula, elementum finibus lacus ultricies vitae. Proin quis feugiat mauris. Vivamus fermentum tellus ligula, ac scelerisque nunc volutpat nec.</p>\r\n			<p>Nulla eros lorem, imperdiet non pulvinar in, feugiat sed lectus. Vivamus eros velit, lobortis sem\r\n		eget, egestas bibendum sem, Fusce eu enim sed libero varius facilisis nec non libero. Donec\r\n		massa turpis, faucibus id felis a, rhoncus facilisis est. Nunc at dignissim eros, elementum lacus.\r\n		Sed porta justo eu finibus ultrices. Donec efficitur mi nec euismod vulputate. Donec feugiat\r\n		placerat fermentum. Aliquam erat volutpat. </p>\r\n			<p>Nulla eros lorem, imperdiet non pulvinar in, feugiat sed lectus. Vivamus eros velit, lobortis sem\r\n		eget, egestas bibendum sem, Fusce eu enim sed libero varius facilisis nec non libero. Donec\r\n		massa turpis, faucibus i